import React from 'react';
import {Nav,NavLink} from 'react-bootstrap';

function NavBars() {
    return (
			<div>
				<Nav>
					<NavLink href='/'>
						<icon>
							/home/gary/sei/projects/Current-News-/current-news-app/public/favicon-32x32.png
						</icon>
					</NavLink>
					<NavLink href='/about'>
						<h2>About</h2>
					</NavLink>
					<NavLink href='/daily-picture'>
						<h2>Daily picture</h2>
					</NavLink>
					<NavLink href='/categories'>
						<h2>Categories</h2>
					</NavLink>
				</Nav>
			</div>
		);
}

export default NavBars;
